export default function DrawGraph(data1) {
    var d1 = [1, 2, 3];


    function reload(e) {
        console.log("button pressed")
        count += 1;
        DrawGraph(d1)

        useEffect(() => {
            fetch("/members").then(
                res => res.json()
            ).then(
                data => {
                    setData(data)
                    console.log(data)
                }
            )
        }, [])
    }

    console.log(d1)
    console.log(count)
    return (
        <div className='bar-chart'>
            <Bar
            data = {{
                labels:data1.members,
                datasets: [{
                    label: '# of votesk',
                    data: d1,
                }

                ]
            }}
            height={400}
            width={600}
            />

        <div className={`button`}>
            <button value="[1, 2, 3]" onClick={reload}>Big Button</button>
        </div>

        </div>



        )


}

